import React from 'react'
import myData from '../backend/trie';
import { Tree, treeUtil } from 'react-d3-tree';

treeUtil.parseJSON(myData)
  .then((data) => {
    this.setState({ data })
  })

const VisualSide = () => (
	<div id="treeWrapper" style={{width: '50em', height: '20em'}}>

		<Tree data={myData} />

	</div>

)

export default VisualSide
